Those are pretty interesting, and clear. I&#39;m thinking I should use some
mor=
e basic methods maybe.



 Frank



________________________________

Fro=
m: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf
Of Jo=
dy Cupp
Sent: Tuesday, June 20, 2006 11:38 AM
To: EVP-ITC@yahoogroups.com
S=
ubject: Re: [EVP-ITC] from my ohio investigation



I&#39;m just going to post=
 them lol and explain them.



This one I was telling A and L that as soon=
 as I got out of the car I
could hear them talking.  Spirit replies &quot;that&#39;s=
 a first&quot;



The next one is a forward and reverse I hear  &quot;Is she the one=
&quot; with a
male voice. In reverse I hear a male voice say &quot;now listen&quot;



I =
could feel them right on my back most of the time.  This one is one of
my c=
ontacts.  He must of came with me for the trip.  He says &quot;look at
her&quot; at t=
he begining, then I talk about how I can feel them piggy
backing me.



Th=
e next one L is speaking, but directly after I hear a female voice
sing &quot;ta=
lk to me&quot;



The next one we were upset about the condition of the grave y=
ard.  These
are monuments of their life here on earth after all.  Spirit sa=
ys &quot;Once
respected&quot; 



The next one.  I hear a woman whisper in &quot;MY voice=
&quot; say &quot;I can (can&#39;t)
block her&quot;



The next one. It sounds like they want =
the men to go.  &quot;we all feel the
men go&quot; then a male voice says &quot;come in&quot; w=
e were at the mouth of a trail
when this was recorded, that was blocked off=
 to motor vehicles.



	----- Original Message ----- 

	From: Jody Cupp &lt;m=
