	Frank,

	I asked my contacts to let them know I would be there, the da=
y
before.  :) I think that helps, to put the energy out of what your
intent=
 is, before you go.



	Jody



		----- Original Message ----- 

		From=
: Sumption Frank &lt;mailto:fsumption@...&gt;  

		To: EVP-ITC@yahoogro=
ups.com 

		Sent: Tuesday, June 20, 2006 12:49 PM

		Subject: RE: [EVP-ITC]=
 from my ohio investigation



		Those are interesting for a graveyard. =
I wouldn&#39;t think
the dead would hang around grave yards, that&#39;s why it&#39; not=
 my first
choice to record at. Gonna have to re-think some of my pre-concep=
tions!

		 Frank



________________________________


		From: EVP-ITC@=
yahoogroups.com
&lt;mailto:EVP-ITC@yahoogroups.com&gt;  [mailto:EVP-ITC@yahoogrou=
