Behalf Of Jody Cupp
		Sent: Tuesday, June 20, 2006 10:22 AM
		To=
: EVP-ITC@yahoogroups.com
		Subject: Re: [EVP-ITC] from my ohio investigati=
on

		Here is two more.. LOL.. I need to motivate myself to
make the web pa=
ge. blahh

		Any way.  There was this one Grave that we believed was
Elizab=
eths.  We went over there 3 times and could smell lilacs after
awhile.  It =
wasn&#39;t immediate, it just slowly came upon us. There was
nothing around us =
to create that odor (not even in the woods), so I&#39;m
guessing they were send=
ing it to us. When I say &quot;what are these&quot; I was
picking up some of those pu=
rple flowers that grow from clover.  They did
not produce the scent we were=
 smelling!! It was incredible.  I have
experienced this before and to me, i=
t means close to the same thing as
roses.  A welcoming, of love and peace.
=




